// import React from "react";
export default function Practice() {
  return (
   <div style={{ display: 'flex', position: 'relative', backgroundColor: 'blue'}}>
    <button style={{ background: 'grey', position: 'absolute', marginRight: 0}}>-</button>
    <div style={{ background: 'green', width: '60px', display: 'flex', justifyContent: 'center', alignItems: 'center', position: 'absolute'}}>
      <h1 style={{ color: 'black'}}>0</h1>
    </div>
    <button style={{ background: 'grey', position: 'absolute', marginRight: '200px' }}>+</button>
   </div>
  );
};
